//Edhaya Login

import React, { useState } from "react";

import './Component.css';
import { Link, useHistory} from 'react-router-dom';
import EmployeeService from '../services/EmployeeService';
const Login = () => {

const [username, setUsername] = useState('');
const [password, setPassword] = useState('');
const history = useHistory();
const employeeLogin={username,password};
const HandleSubmit=(e)=>
{
e.preventDefault();
EmployeeService.login(employeeLogin).then((response) => {
  
   if(response.data.position==="Admin"){      
        history.push("/employees");
       
    }
    else {
       
        console.log("Logged in by : "+response.data.position);
     
        history.push("/view-employee/"+response.data.id);
        }
}).catch(error => {
    console.log(error);
})

}

return (
    <>
              <div className="login">
              <div className="form">
                  <h2>Login</h2>
                  <label htmlFor="adminCode">Admin Code</label>
                  <input type="userName" placeholder="Enter Your Admin Code" id="adminCode" onChange={(e) => setUsername(e.target.value)}  />
                  <label htmlFor="pass1">Password</label>
                  <input type="password" placeholder="Password" value={password} id="pass1" onChange={(e) => setPassword(e.target.value)} />
                  <center><button className="btn btn-login" onChange={(e) => HandleSubmit(e)} >Login</button></center>
                </div>
                <img src="./bengaluru.jpg" alt="emp" className="img"/> 
              </div>
    </>

);

};

export default Login;
